import { SettingsInputComponent } from "@material-ui/icons";
import React, { useState } from "react";

const Title=()=>{
    const [num,setnum]=useState(0);


return(
    <button onClick={()=>{
        setnum(num+1);
        
    }}>Click me {num}</button>
)

}
export default Title;
